import React, { Component } from 'react'

export default class Transformers extends Component {
  componentWillMount() {
      fetch('../db.json')
      .then(response => response.json())
      .then(json => console.log(json, 123));
  }

  render() {
    return (
      <div>
        <h1>Transformer app</h1>
      </div>
    )
  }
}
